INSERT INTO Artwork(Title,Year,Medium,Width,Height,Depth,CreditLine,Classification,Department,YearAcquired,CuratorApproved,ObjectID) VALUES ('The World War had caused a great shortage in Northern industry and also citizens of foreign countries were returning home',1940,'Casein tempera on hardboard',30.5,45.7,null,'Gift of Mrs. David M. Levy','Painting','Painting & Sculpture',1942,'Y',78526);
INSERT INTO Artwork(Title,Year,Medium,Width,Height,Depth,CreditLine,Classification,Department,YearAcquired,CuratorApproved,ObjectID) VALUES ('In many of the communities the Negro press was read continually because of its attitude and its encouragement of the movement',1940,'Casein tempera on hardboard',45.7,30.5,null,'Gift of Mrs. David M. Levy','Painting','Painting & Sculpture',1942,'Y',78528);
INSERT INTO Artwork(Title,Year,Medium,Width,Height,Depth,CreditLine,Classification,Department,YearAcquired,CuratorApproved,ObjectID) VALUES ('Another of the social causes of the migrants'' leaving was that at times they did not feel safe |  or it was not the best thing to be found on the streets late at night. They were arrested on the slightest provocation',1940,'Casein tempera on hardboard',30.5,45.7,null,'Gift of Mrs. David M. Levy','Painting','Painting & Sculpture',1942,'Y',78529);
INSERT INTO Artwork(Title,Year,Medium,Width,Height,Depth,CreditLine,Classification,Department,YearAcquired,CuratorApproved,ObjectID) VALUES ('Child labor and a lack of education was one of the other reasons for people wishing to leave their homes',1940,'Casein tempera on hardboard',30.5,45.7,null,'Gift of Mrs. David M. Levy','Painting','Painting & Sculpture',1942,'Y',78530);
INSERT INTO Artwork(Title,Year,Medium,Width,Height,Depth,CreditLine,Classification,Department,YearAcquired,CuratorApproved,ObjectID) VALUES ('And people all over the South began to discuss this great movement',1940,'Casein tempera on hardboard',45.7,30.5,null,'Gift of Mrs. David M. Levy','Painting','Painting & Sculpture',1942,'Y',78531);
INSERT INTO Artwork(Title,Year,Medium,Width,Height,Depth,CreditLine,Classification,Department,YearAcquired,CuratorApproved,ObjectID) VALUES ('The labor agent who had been sent South by Northern industry was a very familiar person in the Negro counties',1940,'Casein tempera on hardboard',45.7,30.5,null,'Gift of Mrs. David M. Levy','Painting','Painting & Sculpture',1942,'Y',78532);
INSERT INTO Artwork(Title,Year,Medium,Width,Height,Depth,CreditLine,Classification,Department,YearAcquired,CuratorApproved,ObjectID) VALUES ('In every home people who had not gone North met and tried to decide if they should go North or not',1940,'Casein tempera on hardboard',30.5,45.7,null,'Gift of Mrs. David M. Levy','Painting','Painting & Sculpture',1942,'Y',78533);
INSERT INTO Artwork(Title,Year,Medium,Width,Height,Depth,CreditLine,Classification,Department,YearAcquired,CuratorApproved,ObjectID) VALUES ('The railroad stations in the South were crowded with people leaving for the North',1940,'Casein tempera on hardboard',30.5,45.7,null,'Gift of Mrs. David M. Levy','Painting','Painting & Sculpture',1942,'Y',78534);
INSERT INTO Artwork(Title,Year,Medium,Width,Height,Depth,CreditLine,Classification,Department,YearAcquired,CuratorApproved,ObjectID) VALUES ('The Negro press was also influential in urging the people to leave the South',1940,'Casein tempera on hardboard',45.7,30.5,null,'Gift of Mrs. David M. Levy','Painting','Painting & Sculpture',1942,'Y',78535);
INSERT INTO Artwork(Title,Year,Medium,Width,Height,Depth,CreditLine,Classification,Department,YearAcquired,CuratorApproved,ObjectID) VALUES ('They arrived in great numbers into Chicago |  the gateway of the West',1940,'Casein tempera on hardboard',30.5,45.7,null,'Gift of Mrs. David M. Levy','Painting','Painting & Sculpture',1942,'Y',78536);
INSERT INTO Artwork(Title,Year,Medium,Width,Height,Depth,CreditLine,Classification,Department,YearAcquired,CuratorApproved,ObjectID) VALUES ('They also worked in large numbers on the railroad',1940,'Casein tempera on hardboard',30.5,45.7,null,'Gift of Mrs. David M. Levy','Painting','Painting & Sculpture',1942,'Y',78537);
INSERT INTO Artwork(Title,Year,Medium,Width,Height,Depth,CreditLine,Classification,Department,YearAcquired,CuratorApproved,ObjectID) VALUES ('The Negro was the largest source of labor to be found after all others had been exhausted',1940,'Casein tempera on hardboard',45.7,30.5,null,'Gift of Mrs. David M. Levy','Painting','Painting & Sculpture',1942,'Y',78538);
INSERT INTO Artwork(Title,Year,Medium,Width,Height,Depth,CreditLine,Classification,Department,YearAcquired,CuratorApproved,ObjectID) VALUES ('The migrants arrived in great numbers',1940,'Casein tempera on hardboard',30.5,45.7,null,'Gift of Mrs. David M. Levy','Painting','Painting & Sculpture',1942,'Y',78539);
INSERT INTO Artwork(Title,Year,Medium,Width,Height,Depth,CreditLine,Classification,Department,YearAcquired,CuratorApproved,ObjectID) VALUES ('They also made it very difficult for migrants leaving the South. They often went to railroad stations and arrested the Negroes wholesale |  which in turn made them miss their train',1940,'Casein tempera on hardboard',45.7,30.5,null,'Gift of Mrs. David M. Levy','Painting','Painting & Sculpture',1942,'Y',78540);
INSERT INTO Artwork(Title,Year,Medium,Width,Height,Depth,CreditLine,Classification,Department,YearAcquired,CuratorApproved,ObjectID) VALUES ('Living conditions were better in the North',1940,'Casein tempera on hardboard',30.5,45.7,null,'Gift of Mrs. David M. Levy','Painting','Painting & Sculpture',1942,'Y',78541);
INSERT INTO Artwork(Title,Year,Medium,Width,Height,Depth,CreditLine,Classification,Department,YearAcquired,CuratorApproved,ObjectID) VALUES ('Industries attempted to board their labor in quarters that were oftentimes very unhealthy. Labor camps were numerous',1940,'Casein tempera on hardboard',45.7,30.5,null,'Gift of Mrs. David M. Levy','Painting','Painting & Sculpture',1942,'Y',78542);
INSERT INTO Artwork(Title,Year,Medium,Width,Height,Depth,CreditLine,Classification,Department,YearAcquired,CuratorApproved,ObjectID) VALUES ('Housing for the Negroes was a very difficult problem',1940,'Casein tempera on hardboard',45.7,30.5,null,'Gift of Mrs. David M. Levy','Painting','Painting & Sculpture',1942,'Y',78543);
INSERT INTO Artwork(Title,Year,Medium,Width,Height,Depth,CreditLine,Classification,Department,YearAcquired,CuratorApproved,ObjectID) VALUES ('Race riots were very numerous all over the North because of the antagonism that was caused between the Negro and white workers. Many of these riots occurred because the Negro was used as a strike breaker in many of the Northern industries',1940,'Casein tempera on hardboard',45.7,30.5,null,'Gift of Mrs. David M. Levy','Painting','Painting & Sculpture',1942,'Y',78544);
INSERT INTO Artwork(Title,Year,Medium,Width,Height,Depth,CreditLine,Classification,Department,YearAcquired,CuratorApproved,ObjectID) VALUES ('One of the largest race riots occurred in East St. Louis',1940,'Casein tempera on hardboard',30.5,45.7,null,'Gift of Mrs. David M. Levy','Painting','Painting & Sculpture',1942,'Y',78545);
INSERT INTO Artwork(Title,Year,Medium,Width,Height,Depth,CreditLine,Classification,Department,YearAcquired,CuratorApproved,ObjectID) VALUES ('One of the main forms of social and recreational activities in which the migrants indulged occurred in the church',1940,'Casein tempera on hardboard',45.7,30.5,null,'Gift of Mrs. David M. Levy','Painting','Painting & Sculpture',1942,'Y',78546);
INSERT INTO Artwork(Title,Year,Medium,Width,Height,Depth,CreditLine,Classification,Department,YearAcquired,CuratorApproved,ObjectID) VALUES ('Among one of the last groups to leave the South was the Negro professional who was forced to follow his clientele to make a living',1940,'Casein tempera on hardboard',30.5,45.7,null,'Gift of Mrs. David M. Levy','Painting','Painting & Sculpture',1942,'Y',78547);
INSERT INTO Artwork(Title,Year,Medium,Width,Height,Depth,CreditLine,Classification,Department,YearAcquired,CuratorApproved,ObjectID) VALUES ('In the North the Negro had better educational facilities',1940,'Casein tempera on hardboard',30.5,45.7,null,'Gift of Mrs. David M. Levy','Painting','Painting & Sculpture',1942,'Y',78548);
INSERT INTO Artwork(Title,Year,Medium,Width,Height,Depth,CreditLine,Classification,Department,YearAcquired,CuratorApproved,ObjectID) VALUES ('The trains were packed continually with migrants',1940,'Casein tempera on hardboard',45.7,30.5,null,'Gift of Mrs. David M. Levy','Painting','Painting & Sculpture',1942,'Y',78549);
INSERT INTO Artwork(Title,Year,Medium,Width,Height,Depth,CreditLine,Classification,Department,YearAcquired,CuratorApproved,ObjectID) VALUES ('And the migrants kept coming',1940,'Casein tempera on hardboard',30.5,45.7,null,'Gift of Mrs. David M. Levy','Painting','Painting & Sculpture',1942,'Y',78550);
INSERT INTO Artwork(Title,Year,Medium,Width,Height,Depth,CreditLine,Classification,Department,YearAcquired,CuratorApproved,ObjectID) VALUES ('They did not always leave because they were promised work in the North. Many of them left because of Southern conditions |  one of them being great floods that ruined the crops |  and therefore they were unable to make a living where they were',1940,'Casein tempera on hardboard',45.7,30.5,null,'Gift of Mrs. David M. Levy','Painting','Painting & Sculpture',1942,'Y',78551);
INSERT INTO Artwork(Title,Year,Medium,Width,Height,Depth,CreditLine,Classification,Department,YearAcquired,CuratorApproved,ObjectID) VALUES ('They were very poor',1940,'Casein tempera on hardboard',30.5,45.7,null,'Gift of Mrs. David M. Levy','Painting','Painting & Sculpture',1942,'Y',78552);
INSERT INTO Artwork(Title,Year,Medium,Width,Height,Depth,CreditLine,Classification,Department,YearAcquired,CuratorApproved,ObjectID) VALUES ('The railroad stations were at times so over-packed with people leaving that special guards had to be called in to keep order',1940,'Casein tempera on hardboard',30.5,45.7,null,'Gift of Mrs. David M. Levy','Painting','Painting & Sculpture',1942,'Y',78553);
INSERT INTO Artwork(Title,Year,Medium,Width,Height,Depth,CreditLine,Classification,Department,YearAcquired,CuratorApproved,ObjectID) VALUES ('Among the social conditions that existed which was partly the cause of the migration was the injustice done to the Negroes in the courts',1940,'Casein tempera on hardboard',45.7,30.5,null,'Gift of Mrs. David M. Levy','Painting','Painting & Sculpture',1942,'Y',78554);
INSERT INTO Artwork(Title,Year,Medium,Width,Height,Depth,CreditLine,Classification,Department,YearAcquired,CuratorApproved,ObjectID) VALUES ('Although the Negro was used to lynching |  he found this an opportune time for him to leave where one had occurred',1940,'Casein tempera on hardboard',45.7,30.5,null,'Gift of Mrs. David M. Levy','Painting','Painting & Sculpture',1942,'Y',78555);
INSERT INTO Artwork(Title,Year,Medium,Width,Height,Depth,CreditLine,Classification,Department,YearAcquired,CuratorApproved,ObjectID) VALUES ('The migration gained in momentum',1940,'Casein tempera on hardboard',45.7,30.5,null,'Gift of Mrs. David M. Levy','Painting','Painting & Sculpture',1942,'Y',78556);
